var listTestAttempts = async (userId) => {
  const attempts = await TestAttempt_default.find({ nguoiDung: userId }).populate("luaChon.cauHoi").exec();
  return attempts.map((attempt) => ({
    ngayBatDauThi: attempt.ngayBatDauThi,
    thoiGianLamBai: attempt.thoiGianLamBai,
    soCau: attempt.luaChon.length,
    soCauDung: attempt.luaChon.reduce((count, choice) => {
      const question = choice.cauHoi;
      if (choice.chon === null)
        return count;
      return count + (question.luaChon.some((option) => option.dapAn && option.index === choice.chon) ? 1 : 0);
    }, 0)
  }));
};
var createTestAttempt = async (userId) => {
  const totalQuestions = await Question_default.countDocuments();
  const questionsToSelect = Math.min(20, totalQuestions);
  const randomQuestions = await Question_default.aggregate([
    { $sample: { size: questionsToSelect } }
  ]);
  const testAttempt = new TestAttempt_default({
    nguoiDung: userId,
    luaChon: randomQuestions.map((question) => ({
      cauHoi: question._id
    }))
  });
  return await testAttempt.save();
};
var submitTestAttempt = async (testAttemptId, choices) => {
  const testAttempt = await TestAttempt_default.findById(testAttemptId);
  if (!testAttempt) {
    throw new Error("Test attempt not found");
  }
  testAttempt.thoiGianLamBai = Math.floor(Date.now() - testAttempt.ngayBatDauThi.getDate() / (1000 * 60));
  for (const [questionId, select] of choices.entries()) {
    const question = testAttempt.luaChon.find((q) => q.cauHoi.toString() === questionId);
    if (question) {
      question.chon = select;
    }
  }
};
